import React, {  useState } from "react";
import axios from './api/axios';
import {useNavigate,NavLink} from 'react-router-dom'


const REGISTER_URL = '/register';

const Register = () => {


    const [user, setUser] = useState('');
    const [pwd, setPwd] = useState('');
    const [matchPwd, setMatchPwd] = useState('');
    const [userError,setUserError] = useState('');
    const [pwdError, setPwdError] = useState('');
    const [ConPwdError,setConPwdError] =useState('')
    const navigate =useNavigate('');

    const handleSubmit = async (e) => {
        e.preventDefault('');

        if(!user){
            setUserError("Please add a username");
        }else if( !pwd){
            setPwdError("Enter a password")
        }
        else if(pwd !== matchPwd){
            setConPwdError("")
        }


        try {
            const response = await axios.post(REGISTER_URL,
                JSON.stringify({ user, pwd }),
                {
                    headers: { 'Content-Type': 'application/json' },
                    withCredentials: true
                }
            );


            setUser('');
            setPwd('');
            setMatchPwd('');
        } catch (err) {

             alert("Registration Failed")
        }
    }

    return (
        <>

                <section>
                     <div className="top">
       <div><h3>Todos</h3></div>
       </div>
                    <form onSubmit={handleSubmit}>
                    <div className="container">
        <div className="content" >
            <div className="topic">
                <lable id="title"><strong>Register for free</strong></lable>
                <div id="main" align="center">
                    <input  type="text"
                            id="username"
                            onChange={(e) => setUser(e.target.value)}
                            value={user}
                            required
                             placeholder="Username" />
                             {userError && {userError}}

                    <input type="password"
                            id="password"
                            onChange={(e) => setPwd(e.target.value)}
                            value={pwd}
                            required
                            placeholder="Password" />
                            {pwdError&&{pwdError}}

                    <input  type="password"
                            id="confirm_pwd"
                            onChange={(e) => setMatchPwd(e.target.value)}
                            value={matchPwd}
                            required
                             placeholder="Confirm Password" />
                             {ConPwdError && {ConPwdError}}

                    <div>
                        <button id="butclasston" type="submit"><b>Register</b></button>
                    </div>
                    <div className="direct">
                       <NavLink  to={"/"}>Have an account?Login now </NavLink>
                    </div>
                </div>
            </div>
        </div>
    </div>


                    </form>

                </section>

        </>
    )
}

export default Register
